import React from "react";
import Featurebox from "./Featurebox";
import figure1 from "../images/happy1.jpg";
import figure2 from "../images/happy2.jpg";
import figure3 from "../images/happy3.jpg";
import figure4 from "../images/happy4.jpg";
import figure5 from "../images/happy5.jpg";

function Offer() {
  return (
    <div id="presentaion">
      <h1 color="white">Happy Customer </h1>
      <div className="a-container">
        <Featurebox image={figure1} title="Gym training" />
        <Featurebox image={figure2} title="Excercises" />
        <Featurebox image={figure3} title="Balance Diet" />
        <Featurebox image={figure4} title="Cardio Exercise" />
        <Featurebox image={figure5} title="Cardio Exercise" />
      </div>
    </div>
  );
}

export default Offer;
